import React from "react";

const Item = (props) => {
  return (
    <div>
      <tr>
        <td>{props.name}</td>
        <td>{props.category}</td>
        <td>{props.price}</td>
        <td>{props.date}</td>
        <td>
          <a href="#" class="btn btn-secondary">
            Delete
          </a>
        </td>
      </tr>
    </div>
  );
};

export default Item;
